async function seed() {
  console.log('Seeding categories...');
  try {
    await prisma.category.deleteMany({});
    const map = new Map();
    for (const cat of categories) {
      const parentId = cat.parent ? map.get(cat.parent) : null;
      const created = await prisma.category.create({
        data: { name: cat.name, nameAr: cat.name, slug: cat.slug, level: cat.level, parentId, displayOrder: cat.order, isActive: true }
      });
      map.set(cat.slug, created.id);
    }
    console.log('Done! Created', categories.length, 'categories');
  } catch (e) {
    console.error(e);
    process.exit(1);
  } finally {
    await prisma.$disconnect();
  }
}

seed();
